// AccessibilityFAB.jsx (estilo UserWay)
import React, { useState, useContext } from 'react';
import {
  Box,
  Fab,
  Drawer,
  Typography,
  Grid,
  IconButton
} from '@mui/material';
import AccessibilityNewIcon from '@mui/icons-material/AccessibilityNew';
import ContrastIcon from '@mui/icons-material/Tonality';
import PsychologyIcon from '@mui/icons-material/Psychology';
import TextFieldsIcon from '@mui/icons-material/TextFields';
import ImageIcon from '@mui/icons-material/Image';
import AnimationIcon from '@mui/icons-material/MotionPhotosOff';
import LinkIcon from '@mui/icons-material/Link';
import MouseIcon from '@mui/icons-material/Mouse';
import VisibilityIcon from '@mui/icons-material/Visibility';
import FormatSizeIcon from '@mui/icons-material/FormatSize';
import VolumeUpIcon from '@mui/icons-material/VolumeUp';
import InvertColorsIcon from '@mui/icons-material/InvertColors';
import { AccessibilityContext } from '../../context/AccessibilityContext';

export default function AccessibilityFAB() {
  const [open, setOpen] = useState(false);
  const {
    altoContraste,
    modoDislexia,
    tamañoTexto,
    espaciadoTexto,
    ocultarImágenes,
    resaltarEnlaces,
    detenerAnimaciones,
    modoLupa,
    modoMonocromatico,
    toggleContraste,
    toggleDislexia,
    aumentarTexto,
    disminuirTexto,
    aumentarEspaciado,
    disminuirEspaciado,
    toggleOcultarImágenes,
    toggleResaltarEnlaces,
    toggleAnimaciones,
    toggleModoLupa,
    toggleMonocromatico,
    leerTexto
  } = useContext(AccessibilityContext);

  const botones = [
    { icon: <InvertColorsIcon />, label: 'Invertir colores', onClick: toggleMonocromatico },
    { icon: <VolumeUpIcon />, label: 'Leer pantalla', onClick: () => leerTexto(document.body.innerText.slice(0, 500)) },
    { icon: <ContrastIcon />, label: 'Alto contraste', onClick: toggleContraste },
    { icon: <LinkIcon />, label: 'Resaltar enlaces', onClick: toggleResaltarEnlaces },
    { icon: <FormatSizeIcon />, label: 'Aumentar texto', onClick: aumentarTexto },
    { icon: <TextFieldsIcon />, label: 'Espaciado texto', onClick: aumentarEspaciado },
    { icon: <AnimationIcon />, label: 'Detener animaciones', onClick: toggleAnimaciones },
    { icon: <ImageIcon />, label: 'Ocultar imágenes', onClick: toggleOcultarImágenes },
    { icon: <PsychologyIcon />, label: 'Dislexia', onClick: toggleDislexia },
    { icon: <MouseIcon />, label: 'Modo lupa', onClick: toggleModoLupa },
    { icon: <VisibilityIcon />, label: 'Reducir texto', onClick: disminuirTexto },
    { icon: <TextFieldsIcon />, label: 'Reducir espaciado', onClick: disminuirEspaciado },
  ];

  return (
    <>
      <Fab
        onClick={() => setOpen(true)}
        sx={{
          position: 'fixed',
          bottom: 24,
          right: 24,
          backgroundColor: '#000',
          color: '#fff',
          zIndex: 1300,
          '&:hover': {
            backgroundColor: '#333'
          }
        }}
        aria-label="Accesibilidad"
      >
        <AccessibilityNewIcon fontSize="large" />
      </Fab>

      <Drawer
        anchor="right"
        open={open}
        onClose={() => setOpen(false)}
        PaperProps={{ sx: { width: 360, p: 3 } }}
      >
        <Typography variant="h6" gutterBottom>
          Menú De Accesibilidad
        </Typography>
        <Grid container spacing={2}>
          {botones.map((btn, index) => (
            <Grid item xs={6} key={index}>
              <Box
                onClick={btn.onClick}
                sx={{
                  display: 'flex',
                  flexDirection: 'column',
                  alignItems: 'center',
                  p: 2,
                  backgroundColor: '#f5f5f5',
                  borderRadius: 2,
                  cursor: 'pointer',
                  '&:hover': {
                    backgroundColor: '#e0e0e0'
                  }
                }}
              >
                <IconButton color="primary">{btn.icon}</IconButton>
                <Typography variant="caption" align="center">
                  {btn.label}
                </Typography>
              </Box>
            </Grid>
          ))}
        </Grid>
      </Drawer>
    </>
  );
}
